import React from 'react'
import ATM_Card from './Card_assets/ATM_card.png'

const Acard =({codes}) =>{
        return(
          <div class='p-4'>
          <img src={ATM_Card} alt="ATM Card"></img>
          <p class='text-xs'>{codes.text}</p>
          <p class='text-xs'>{codes.num}</p>
          <progress value={0.5} />
          </div>
        )
      
}

export default Acard
